(1, 'Làm thế nào để đặt được vé trên TOURCOACH ?', 'How to put the tickets on TOURCOACH ?', '<div>\r\n	Để đặt v&eacute; tr&ecirc;n Tourcoach, Qu&yacute; kh&aacute;ch h&agrave;ng c&oacute; thể trực tiếp v&agrave;o website đặt v&eacute; online, đến văn ph&ograve;ng hoặc gọi điện v&agrave;o số hotline của Tourcoach để được hỗ trợ. Hotline: 0904.391.391.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	C&aacute;c bước tiến h&agrave;nh đặt v&eacute; online tr&ecirc;n tourcoach.com:</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Bước 1: T&igrave;m kiếm chuyến bay, th&ocirc;ng tin của chặng bay, ng&agrave;y bay v&agrave; gi&aacute; cả ở cột T&igrave;m chuyến bay. Th&ocirc;ng tin tất cả c&aacute;c chuyến bay của c&aacute;c h&atilde;ng h&agrave;ng kh&ocirc;ng sẽ được hiện ra.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Bước 2: Chọn chuyến bay v&agrave; đặt v&eacute;. Qu&yacute; kh&aacute;ch chọn chuyến bay bằng c&aacute;ch k&iacute;ch chuột v&agrave;o v&agrave;o phần gi&aacute; v&eacute; giảm dần để xem tổng h&oacute;a đơn phải thanh to&aacute;n, xem chi tiết chặng bay ở mục chi tiết. Sau đ&oacute;, chọn ĐẶT V&Eacute;.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Bước 3: Nhập th&ocirc;ng tin c&aacute; nh&acirc;n để tiến h&agrave;nh mua v&eacute; bao gồm: Th&ocirc;ng tin kh&aacute;ch h&agrave;ng, th&ocirc;ng tin li&ecirc;n hệ, th&ocirc;ng tin h&agrave;nh l&yacute;, chọn Tiếp tục.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Bước 4: Chọn h&igrave;nh thức thanh to&aacute;n rồi l&agrave;m theo hướng dẫn. Tourcoach sẽ gửi email th&ocirc;ng b&aacute;o x&aacute;c nhận đơn h&agrave;ng cho Qu&yacute; kh&aacute;ch.</div>\r\n<div>\r\n	&nbsp;</div>\r\n', '<p>\r\n	<span id="result_box" lang="en"><span title="Để đặt vé trên Tourcoach, Quý khách hàng có thể trực tiếp vào website đặt vé online, đến văn phòng hoặc gọi điện vào số hotline của Tourcoach để được hỗ trợ.">To book tickets on Tourcoach, customers can directly into online ticketing website, to the office or call the hotline at Tourcoach for assistance. </span><span title="Hotline: 0904.391.391.\r\n\r\n">Hotline: 0904,391,391.</span><br />\r\n	<br />\r\n	<span title="Các bước tiến hành đặt vé online trên tourcoach.com:\r\n\r\n">Steps online ticketing on tourcoach.com:</span><br />\r\n	<br />\r\n	<span title="Bước 1: Tìm kiếm chuyến bay, thông tin của chặng bay, ngày bay và giá cả ở cột Tìm chuyến bay.">Step 1: Search for the flight, flight information, flight date and price in column Find flights. </span><span title="Thông tin tất cả các chuyến bay của các hãng hàng không sẽ được hiện ra.\r\n\r\n">Information all flights of the airline will be displayed.</span><br />\r\n	<br />\r\n	<span title="Bước 2: Chọn chuyến bay và đặt vé.">Step 2: Select the flight and book tickets. </span><span title="Quý khách chọn chuyến bay bằng cách kích chuột vào vào phần giá vé giảm dần để xem tổng hóa đơn phải thanh toán, xem chi tiết chặng bay ở mục chi tiết.">You choose the flight by clicking on the share price declining ticket to see the total bill must be paid, see details in section flight details. </span><span title="Sau đó, chọn ĐẶT VÉ.\r\n\r\n">Then choose BOOKING.</span><br />\r\n	<br />\r\n	<span title="Bước 3: Nhập thông tin cá nhân để tiến hành mua vé bao gồm: Thông tin khách hàng, thông tin liên hệ, thông tin hành lý, chọn Tiếp tục.\r\n\r\n">Step 3: Enter your personal information to facilitate the purchase of tickets including customer information, contact details, baggage information, select Continue.</span><br />\r\n	<br />\r\n	<span title="Bước 4: Chọn hình thức thanh toán rồi làm theo hướng dẫn.">Step 4: Select the payment method and then follow the instructions. </span><span title="Tourcoach sẽ gửi email thông báo xác nhận đơn hàng cho Quý khách.">Tourcoach will send a confirmation email to the customer orders.</span></span></p>\r\n'),
(2, 'Tôi muốn thay đổi hoặc hủy vé đã đặt thì làm thế nào', 'I want to change or cancel already placed then how', '<div>\r\n	Để đặt v&eacute; tr&ecirc;n Tourcoach, Qu&yacute; kh&aacute;ch h&agrave;ng c&oacute; thể trực tiếp v&agrave;o website đặt v&eacute; online, đến văn ph&ograve;ng hoặc gọi điện v&agrave;o số hotline của Tourcoach để được hỗ trợ. Hotline: 0904.391.391.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	C&aacute;c bước tiến h&agrave;nh đặt v&eacute; online tr&ecirc;n tourcoach.com:</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Bước 1: T&igrave;m kiếm chuyến bay, th&ocirc;ng tin của chặng bay, ng&agrave;y bay v&agrave; gi&aacute; cả ở cột T&igrave;m chuyến bay. Th&ocirc;ng tin tất cả c&aacute;c chuyến bay của c&aacute;c h&atilde;ng h&agrave;ng kh&ocirc;ng sẽ được hiện ra.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Bước 2: Chọn chuyến bay v&agrave; đặt v&eacute;. Qu&yacute; kh&aacute;ch chọn chuyến bay bằng c&aacute;ch k&iacute;ch chuột v&agrave;o v&agrave;o phần gi&aacute; v&eacute; giảm dần để xem tổng h&oacute;a đơn phải thanh to&aacute;n, xem chi tiết chặng bay ở mục chi tiết. Sau đ&oacute;, chọn ĐẶT V&Eacute;.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Bước 3: Nhập th&ocirc;ng tin c&aacute; nh&acirc;n để tiến h&agrave;nh mua v&eacute; bao gồm: Th&ocirc;ng tin kh&aacute;ch h&agrave;ng, th&ocirc;ng tin li&ecirc;n hệ, th&ocirc;ng tin h&agrave;nh l&yacute;, chọn Tiếp tục.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Bước 4: Chọn h&igrave;nh thức thanh to&aacute;n rồi l&agrave;m theo hướng dẫn. Tourcoach sẽ gửi email th&ocirc;ng b&aacute;o x&aacute;c nhận đơn h&agrave;ng cho Qu&yacute; kh&aacute;ch.</div>\r\n<div>\r\n	&nbsp;</div>\r\n', '<p>\r\n	<span id="result_box" lang="en"><span title="Để đặt vé trên Tourcoach, Quý khách hàng có thể trực tiếp vào website đặt vé online, đến văn phòng hoặc gọi điện vào số hotline của Tourcoach để được hỗ trợ.">To book tickets on Tourcoach, customers can directly into online ticketing website, to the office or call th