(1, 'Thanh toán bằng tiền mặt tại văn phòng Tourcoach', 'Payment by cash at the office Tourcoach', '/pi_maybay/view/admin/Themes/kcfinder/upload/images/hinhthuc/icon-thanhtoan1.png', 'Sau khi đăng ký thành công, quý khách vui lòng qua văn phòng công ty để thanh toán và nhận vé.', 'After successful registration, please pass the corporate office to make payment and get ticket.'),
